import React from 'react';

const Weather= (props) => {
  var date = new Date();
  var today = (date.getMonth() + 1) + '/' + date.getDate() + '/' +  date.getFullYear();

  return(
    <div>
      <h2>{today}</h2>
      <p>{props.city}</p>
      <p>{props.description}</p>
    </div>
  )
}

export default Weather;
